import React , {Component} from 'react' ;
import logo from "../assets/images/logo.svg" ;


// {/*<nav className="navbar navbar-expand-lg navbar-dark indigo mb-4">*/}
// {/*    <a className="navbar-brand" href="#">Navbar</a>*/}
//
// {/*    <div className="collapse navbar-collapse" id="navbarSupportedContent">*/}
//
// {/*        <form className="form-inline ml-auto">*/}
// {/*            <div className="md-form my-0">*/}
// {/*                <input className="form-control" type="text" placeholder="Search" aria-label="Search"/>*/}
// {/*            </div>*/}
// {/*            <button href="#!" className="btn btn-outline-white btn-md my-0 ml-sm-2" type="submit">Search</button>*/}
// {/*        </form>*/}
// {/*    </div>*/}
// {/*</nav>*/}

class TopNavBar extends React.Component {
    render() {
        return (
        <div className="container">
            <nav className="selfnav navbar navbar-expand-md bg-light navbar-dark sticky-top">
                <img src={logo} className="App-logo" alt="logo" />
                <a className="navbar-brand" href="#">EOrderButler</a>
                <button className="navbar-toggler navbar-toggler-right" type="button" data-toggle="collapse"
                        data-target="#navb" aria-expanded="true">
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div id="navb" className="navbar-collapse collapse hide">
                    <ul className="navbar-nav">
                        <li className="nav-item active">
                            <a className="nav-link" href="#">Home</a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#">Details</a>
                        </li>
                    </ul>

                    <ul className="nav navbar-nav ml-auto">
                        <li className="nav-item">
                            <a className="nav-link" href="#"><span className="fas fa-user"></span> Sign Up</a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#"><span className="fas fa-sign-in-alt"></span> Login</a>
                        </li>
                    </ul>
                </div>
            </nav>
        </div>

        );
    }
}

export default TopNavBar ;
